import React from 'react';
import { Link } from 'react-router-dom';
import '../App.css';

const Home = () => {
  return (
    <div>
      <h1>Home</h1>
      <button>
        <Link to="/charts">Go to Charts</Link>
      </button>
      <button>
        <Link to="/another-page">Go to Another Page</Link>
      </button>
      <button>
        <Link to="/yet-another-page">Go to Yet Another Page</Link>
      </button>
    </div>
  );
};

export default Home;
